The pandemic has taken a devastating toll on Yemenis that a war-ravaged healthcare sector and a lack of testing have left unquantified. 

@AhmedNagiYE writes. 
https://t.co/iMsn7DPGmD

"Zoonosis is a real thing, and we are the architects of its increase."

#COVID19 is the latest in a long line of deadly zoonoses: diseases that transfer from animals to humans.

@UNEP chief explains what zoonosis is and how it has affected us.
